import React from "react";
import { ThemeContext } from "../../context/Theme";

const ItemCard = () => {
  return (
    
    <div className="w-40 mx-auto bg-white rounded-xl shadow-md overflow-hidden mt-10">
    <div className="md:flex">
      <div className="md:flex-shrink-0">
        <img className="h-48 w-full object-cover md:h-full md:w-48" src="https://source.unsplash.com/random" alt="Card" />
      </div>
      <div className="p-8">
        <div className="uppercase tracking-wide text-sm text-indigo-500 font-semibold">Case Study</div>
        <a href="#" className="block mt-1 text-lg leading-tight font-medium text-black hover:underline">Lorem ipsum dolor sit amet</a>
        <p className="mt-2 text-gray-500">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        <div className="mt-4">
          <button className="rounded-full bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 mr-2">Learn more</button>
          <button className="rounded-full bg-gray-500 hover:bg-gray-700 text-white font-bold py-2 px-4">Buy now</button>
        </div>
      </div>
    </div>
  </div>


  );
};

export default ItemCard;
